function.block:
{
ut32 ret = 0;
ret = (x[y]&0xff) << 24;
ret |= (x[y+1]&0xff) << 16;
ret |= (x[y+2]&0xff) << 8;
ret |= (x[y+3]&0xff);
return ret;
}

